import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Grid from "@material-ui/core/Grid/Grid";
import AppBar    from '@material-ui/core/AppBar';
import Toolbar   from '@material-ui/core/Toolbar';
import Adress from "./Adress";
import Disclaimer from "./Disclaimer";
import Status from "./Status";


const styles = theme => ({
    footer: {},
    text: {
        maxWidth: theme.spacing.getMaxWidth.maxWidth,
        margin: theme.spacing.getMaxWidth.margin,
	width:'90%',
    },
});

function Footer(props) {
    const { classes, state } = props;
    return (
	<div className={classes.footer}>
            <Grid container spacing={24} className={classes.text}>
	       <Grid item xs={3} style={{border: '1px solid red'}}>
 	          <Adress />
	       </Grid>
	       <Grid item xs={3} style={{border: '1px solid red'}}>
	          <Disclaimer />
	       </Grid>
	       <Grid item xs={3} style={{position: 'absolute', right: 0,border: '1px solid red'}}>
	          <status state={state}/>
	       </Grid>
	    </Grid>
        </div>
    );
}

Footer.propTypes = {
    classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(Footer);



